import React from "react";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";

function ResultsPage({ books, coverImageData }) {
  // What happens when there is no data?

  // if(books.length === 0) navigate("/") or leave the decision with user.
  fetch("https://covers/openlibrary.org/b/id/" + books[0].cover_i + "-L.jpg")
  return <div><img src={`https://covers.openlibrary.org/b/id/${coverImageData}-L.jpg`} />{JSON.stringify(books)}</div>;
}

export default ResultsPage;
